L.HtmlIcon = L.Icon.extend({
  options: {},
  initialize: function (options) {
    L.Util.setOptions(this, options);
  },
  createIcon: function () {
    let div = document.createElement('div');
    div.innerHTML = this.options.html;
    return div;
  },
  createShadow: function () {
    return null;
  }
});

function pokeHTML(pokemon) {
  return "<div class='pokemon_icon'><img class='pokemon_icon_img' src='" + "https://pkmref.com/images/set_1/" + pokemon.id + ".png" + "' /></div>";
}

function Pokemon(pokemon_dict) {
  this.id = pokemon_dict['pokemon_id'];
  this.lat = pokemon_dict['lat'];
  this.lng = pokemon_dict['lng'];
  this.despawn = parseInt(pokemon_dict['despawn']);
  this.disguise = parseInt(pokemon_dict['disguise'] || 0);
  this.cp = parseInt(pokemon_dict['cp'] || -1);
  this.attack = parseInt(pokemon_dict['attack'] || -1);
  this.defence = parseInt(pokemon_dict['defence'] || -1);
  this.stamina = parseInt(pokemon_dict['stamina'] || -1);
  this.iv = this.attack >= 0 ? (this.attack + this.defence + this.stamina) / 45 * 100 : -1;
  this.move1 = parseInt(pokemon_dict['move1'] || -1);
  this.move2 = parseInt(pokemon_dict['move2'] || -1);
  this.costume = parseInt(pokemon_dict['costume'] || -1);
  this.gender = parseInt(pokemon_dict['gender'] || -1);
  this.shiny = parseInt(pokemon_dict['shiny'] || -1);
  this.form = parseInt(pokemon_dict['form'] || -1);
  this.level = parseInt(pokemon_dict['level']);
  this.weather = parseInt(pokemon_dict['weather']);
  this.isEqual = function(pokemon) {
    return this.id === pokemon.id && this.lat === pokemon.lat && this.lng === pokemon.lng && this.despawn === pokemon.despawn;
  };
  this.remainingTime = function() {
    return this.despawn - (Math.floor(Date.now() / 1000) - timeOffset);
  };
}

