function getInstantFilter() {
  let filter = { min_iv: parseInt($('#min_iv').val()) || 0, min_level: parseInt($('#min_level').val()) || 0, min_cp: parseInt($('#min_cp').val()) || 0, min_moveset_rank: parseInt($('#min_moveset_rank').val()) || 0, pokemons: {} };
  for (let i = 0; i < pokeArray.length; i++) {
    filter.pokemons[pokeArray[i].i] = $('#pokemon_checkbox_' + pokeArray[i].i).is(':checked');
  }
  return filter;
}

function setInstantFilter(filter) {
  $('#min_iv').val(filter.min_iv);
  $('#min_level').val(filter.min_level);
  $('#min_cp').val(filter.min_cp);
  $('#min_moveset_rank').val(filter.min_moveset_rank);
  for (let i = 0; i < pokeArray.length; i++) {
    $('#pokemon_checkbox_' + pokeArray[i].i).prop('checked', filter.pokemons[pokeArray[i].i]);
  }
  if ($('#instant_filter_enable').is(':checked')) {
    updateFilters();
  }
}

function updateFilters() {
  currentFilters = [];
  if ($('#instant_filter_enable').is(':checked')) {
    let filter = getInstantFilter();
    filter.min_iv = filter.min_iv || -1;
    filter.min_level = filter.min_level || -1;
    filter.min_cp = filter.min_cp || -1;
    currentFilters.push(filter);
  } else {
    let numFilters = $('#all_filter_div').children().length;
    for (let i = 1; i <= numFilters; i++) {
      if ($('#filter_enable_' + i).is(':checked')) {
        let filter = JSON.parse(localStorage.getItem('home_filter_' + i));
        filter.min_iv = filter.min_iv || -1;
        filter.min_level = filter.min_level || -1;
        filter.min_cp = filter.min_cp || -1;
        currentFilters.push(filter);
      }
    }
  }
}

function passFilters(pokemon) {
  for (let i = 0; i < currentFilters.length; i++) {
    if (currentFilters[i].pokemons[pokemon.id] && pokemon.iv >= currentFilters[i].min_iv && pokemon.level >= currentFilters[i].min_level && pokemon.cp >= currentFilters[i].min_cp) {
      let movesetRank = 0;
      if (pokemon.move1 !== -1 && pokemon.move2 !== -1) {
        movesetRank = rankToInt[rankDict[pokemon.id].m[pokemon.move1 + ',' + pokemon.move2]];
      }
      return movesetRank >= currentFilters[i].min_moveset_rank;
    }
  }
  return false;
}

function refreshPokemons() {
  if (!shouldUpdate) {
    return;
  }
  let markerLimit = parseInt(localStorage.getItem('marker_limit'));
  let toBeRemovedIndexes = [];
  let currentUnixTime = Math.floor(Date.now() / 1000) - timeOffset;
  for (let i = 0; i < pokemons.length; i++) {
    if (pokemons[i].despawn < currentUnixTime - 10) {
      toBeRemovedIndexes.push(i);
    }
  }
  for (let i = toBeRemovedIndexes.length - 1; i >= 0; i--) {
    pokemons.splice(toBeRemovedIndexes[i], 1);
    if (markers[toBeRemovedIndexes[i]]._map) {
      markers[toBeRemovedIndexes[i]].removeFrom(map);
      numMarkersDisplayed--;
    }
    markers.splice(toBeRemovedIndexes[i], 1);
  }
  for (let i = 0; i < pokemons.length; ++i) {
    if (passFilters(pokemons[i])) {
      if (!markers[i]._map && numMarkersDisplayed < markerLimit) {
        markers[i].addTo(map);
        numMarkersDisplayed++;
      }
    } else {
      if (markers[i]._map) {
        markers[i].removeFrom(map);
        numMarkersDisplayed--;
      }
    }
  }
}

function refreshMarker() {
  if (selectedMarker) {
    let index = -1;
    for (let i = 0; i < markers.length; i++) {
      if (markers[i] === selectedMarker) {
        index = i;
        break;
      }
    }
    if (index != -1) {
      markers[index].bindPopup(infoWindowString(pokemons[index]));
    }
  }
  if (locationMarker) {
    map.locate();
  }
}

function inPokemons(pokemon) {
  for (let i = 0; i < pokemons.length; ++i) {
    if (pokemon.isEqual(pokemons[i])) {
      return true;
    }
  }
  return false;
}

function timeToString(seconds) {
  if (seconds < 0) {
    return 'Expired';
  }
  let tmpDate = new Date((Math.floor(Date.now() / 1000) - timeOffset + seconds) * 1000);
  let tmpHours = tmpDate.getHours();
  let ampm = tmpHours >= 12 ? 'pm' : 'am';
  tmpHours = tmpHours % 12;
  tmpHours = tmpHours ? tmpHours : 12;
  tmpHours = '0' + tmpHours;
  let tmpMinutes = '0' + tmpDate.getMinutes();
  let tmpSeconds = '0' + tmpDate.getSeconds();
  let formattedTime = tmpHours.substr(-2) + ':' + tmpMinutes.substr(-2) + ':' + tmpSeconds.substr(-2) + ' ' + ampm;
  let minutes = Math.floor(seconds / 60);
  seconds = seconds % 60;
  let minuteString = '' + minutes;
  let secondString = '' + seconds;
  if (minutes < 10) {
    minuteString = '0' + minuteString;
  }
  if (seconds < 10) {
    secondString = '0' + secondString;
  }
  return minuteString + ':' + secondString + ' (' + formattedTime + ')';
}

function processNewPokemons(newPokemons) {
  let markerLimit = parseInt(localStorage.getItem('marker_limit'));
  for (let i = 0; i < newPokemons.length; ++i) {
    let pokemon = new Pokemon(newPokemons[i]);
    if (Math.floor(Date.now() / 1000) - timeOffset < pokemon.despawn) {
      if (!inPokemons(pokemon)) {
        pokemons.push(pokemon);
        let markerLocation = new L.LatLng(pokemon.lat, pokemon.lng);
        let iconDimension = 36;
        let iconOptions = {
          iconSize: [iconDimension, iconDimension],
          iconAnchor: [iconDimension/2, iconDimension],
          popupAnchor: [0, -iconDimension],
          zIndexOffset: -1000,
          html : pokeHTML(pokemon)
        };
        let htmlIcon = new L.HtmlIcon(iconOptions);
        let marker = new L.Marker(markerLocation, {icon: htmlIcon});
        marker.pokemon = pokemon;
        if (passFilters(pokemon) && numMarkersDisplayed < markerLimit) {
          marker.addTo(map);
          numMarkersDisplayed++;
        }
        marker.bindPopup('');
        markers.push(marker);
        marker.addEventListener('click', function(e) {
          e.target.bindPopup(infoWindowString(e.target.pokemon));
        });
      }
    }
  }
}

function reloadPokemons() {
  let currentTime = Math.floor(Date.now() / 1000);
  if (currentTime - 2 < lastLoad) {
    if (!pendingLoad) {
      pendingLoad = setTimeout(function() {
        reloadPokemons();
      }, (lastLoad + 2 - currentTime) * 1000);
    }
    return;
  }
  pendingLoad = null;
  lastLoad = currentTime;
  let mons = [];
  for (let i in pokeDict) {
    mons.push(i);
  }
  let doneFunction = function(data) {
    if (data === '') {
      return;
    }
    inserted = parseInt(data['meta']['inserted']);
    timeOffset = Math.floor(Date.now() / 1000) - parseInt(data['meta']['time']);
    processNewPokemons(data['pokemons']);
  };
  let data = {};
  data.mons = mons.join(',');
  data.time = Date.now();
  data.since = inserted;
  $.ajax({
    type: 'GET',
    url: 'query2.php',
    data: data
  }).done(doneFunction);
}

function pbCoords(device_index, lat, lng) {
  let pbKey = localStorage.getItem('PB_ACCESS_TOKEN');
  let pbDevices = localStorage.getItem('PB_DEVICES');
  if (pbKey && pbDevices) {
    pbDevices = JSON.parse(pbDevices);
    let ajax = new XMLHttpRequest();
    ajax.open('POST', 'https://api.pushbullet.com/v2/pushes', true);
    ajax.setRequestHeader('Authorization', 'Basic ' + window.btoa(pbKey + ':'));
    ajax.setRequestHeader('Content-Type', 'application/json');
    ajax.send(JSON.stringify({device_iden: pbDevices[device_index].id, type: 'note', title: 'POKETP' + device_index, body: lat + ' ' + lng}));
  }
}

function infoWindowString(pokemon) {
  let disguiseString = (pokemon.disguise != 0 && pokemon.disguise != -1) ? ' (' + pokeDict[pokemon.disguise]['name'] + ')' : '';
  let genderString = ['', ' (Male)', ' (Female)'][pokemon.gender] || '';
  let formString = formDict['' + pokemon.form] ? ' - ' + formDict['' + pokemon.form] : '';
  let weatherString = "<b>Weather boost</b>: ";
  switch (pokemon.weather) {
    case 0:
      weatherString += 'None<br />';
      break;
    case 1:
      weatherString += 'Clear<br />';
      break;
    case 2:
      weatherString += 'Rainy<br />';
      break;
    case 3:
      weatherString += 'Partly Cloudy<br />';
      break;
    case 4:
      weatherString += 'Cloudy<br />';
      break;
    case 5:
      weatherString += 'Windy<br />';
      break;
    case 6:
      weatherString += 'Snow<br />';
      break;
    case 7:
      weatherString += 'Fog<br />';
      break;
    default:
      weatherString = '';
      break;
  }
  let ivString = '';
  let movesetString = '';
  let cpString = '';
  if (pokemon.attack !== -1 && pokemon.defence !== -1 && pokemon.stamina !== -1 && pokemon.move1 !== -1 && pokemon.move2 !== -1 && pokemon.cp !== -1) {
    ivString = '<b>IV:</b> '+ pokemon.attack + ' | ' + pokemon.defence + ' | ' + pokemon.stamina + ' (' + Math.floor((pokemon.attack + pokemon.defence + pokemon.stamina)/45 * 100) + '%)<br />';
    movesetString = '<b>Moveset:</b> ' + (movesDict[pokemon.move1] || pokemon.move1) + ' | ' + (movesDict[pokemon.move2] || pokemon.move2) + ' (' + rankDict[pokemon.id].m[pokemon.move1 + ',' + pokemon.move2] + ')<br />';
    cpString = '<b>CP:</b> ' + pokemon.cp + ' (Level: ' + pokemon.level + ')<br /><br />';
  }
  // let coordsString = ' | <a href="javascript:navigator.clipboard.writeText(\'' + pokemon.lat + ',' + pokemon.lng + '\').then(() => { });">Coords</a>';
  let coordsString = '';
  let pbDevices = localStorage.getItem('PB_DEVICES');
  if (pbDevices) {
    pbDevices = JSON.parse(pbDevices);
    for (let i = 0; i < pbDevices.length; i++) {
      coordsString += ' | <a href="javascript:pbCoords(' + i + ',' + pokemon.lat + ',' + pokemon.lng + ')">' + pbDevices[i].name + '</a>';
    }
  }
  let wikiLink = 'https://pokemongo.gamepress.gg/pokemon/' + pokemon.id + (formDict['' + pokemon.form] === 'Alola' ? '-alolan' : '');
  return '<b><a href="' + wikiLink + '" target="_blank">' + pokeDict[pokemon.id]['name'] + disguiseString + genderString + formString + "</a></b><br /><br />" + weatherString + ivString + movesetString + cpString + timeToString(pokemon.remainingTime()) + ' | <a target="_blank" href="https://maps.google.com/maps?q=' + pokemon.lat + ',' + pokemon.lng + '">Maps</a>' + coordsString;
}

function loadPokemonList() {
  for (let i in pokeArray) {
    let pokemon = pokeArray[i];
    let show_filter = true;
    if (pokemon['h']) {
      show_filter = false;
    }
    pokeDict[pokemon['i']] = {"name": pokemon['n'], 'show_filter': show_filter};
  }

  reloadPokemons();
  refreshPokemons();

  setInterval(function() {
    refreshPokemons();
    refreshMarker();
  }, 1000);
  setInterval(function() {
    reloadPokemons();
  }, 30000);
}

function addFilterElements() {
  let index = $('#all_filter_div').children().length + 1;

  if (index > 100) {
    alert('Maximum number of filters reached!');
    return -1;
  }

  $('#all_filter_div').append($('<div>', {id: 'filter_div_' + index}).css('margin-bottom', '10px').append($('<span>', {id: 'filter_name_' + index}).html('Filter ' + index)).append($('<span>').css('float', 'right').append($('<input>', {type: 'checkbox', id: 'filter_enable_' + index, name: 'filter_enable_' + index})).append($('<label>', {for: 'filter_enable_' + index})).append($('<button>', {type: 'button', id: 'filter_load_' + index, name: 'filter_load_' + index}).html('Load').css('margin-left', '5px')).append($('<button>', {type: 'button', id: 'filter_save_' + index, name: 'filter_save_' + index}).html('Save').css('margin-left', '5px')).append($('<button>', {type: 'button', id: 'filter_rename_' + index, name: 'filter_rename_' + index}).html('Rename').css('margin-left', '5px'))));

  $('#filter_enable_' + index).change(function() {
    if (!$('#instant_filter_enable').is(':checked')) {
      updateFilters();
    }
  });

  $('#filter_load_' + index).click(function() {
    setInstantFilter(JSON.parse(localStorage.getItem('home_filter_' + index)));
  });

  $('#filter_save_' + index).click(function() {
    if (confirm('Do you really want to overwrite filter "' + $('#filter_name_' + index).text() + '" with the current instant filter?')) {
      let filter = getInstantFilter();
      filter.name = $('#filter_name_' + index).text();
      localStorage.setItem('home_filter_' + index, JSON.stringify(filter));
      if (!$('#instant_filter_enable').is(':checked')) {
        updateFilters();
      }
    }
  });

  $('#filter_rename_' + index).click(function() {
    let newName = prompt('Please enter new filter name', $('#filter_name_' + index).text());
    if (newName !== null && newName !== '') {
      $('#filter_name_' + index).html(newName);
      let filter = JSON.parse(localStorage.getItem('home_filter_' + index));
      filter.name = newName;
      localStorage.setItem('home_filter_' + index, JSON.stringify(filter));
    }
  });

  return index;
}

function filterPokemonList() {
  let gen = parseInt($('#pokemon_generation').val());
  let pokemonFirstIndex = [1, 1, 152, 252, 387, 494][gen];
  let pokemonLastIndex = [1000, 151, 251, 386, 493, 649][gen];
  let searchString = $('#pokemon_search').val().toLowerCase();
  let minRanking = parseInt($('#min_rating').val()) || -1;
  for (let i = 0; i < pokeArray.length; i++) {
    let matched = false;
    if (pokeArray[i].i >= pokemonFirstIndex && pokeArray[i].i <= pokemonLastIndex && rankDict[pokeArray[i].i].r >= minRanking) {
      if (pokeArray[i].n.toLowerCase().indexOf(searchString) === 0) {
        matched = true;
      } else {
        for (let j = 0; j < pokeArray[i].types.length; j++) {
          if (typeDict[pokeArray[i].types[j]].toLowerCase().indexOf(searchString) === 0) {
            matched = true;
            break;
          }
        }
      }
    }
    if (matched) {
      $('#pokemon_div_' + pokeArray[i].i).show();
    } else {
      $('#pokemon_div_' + pokeArray[i].i).hide();
    }
  }
}

